import React from 'react'
import './less/Means.less'

import { Button, Checkbox, Form, Input } from 'antd';

export default function Means() {

  return (
    <div className="means">
      <Form
        name="basic"
        style={{
          width: '400px'
        }}
        initialValues={{
        }}
        autoComplete="off"
      >
        <Form.Item
          label="修改用户名: "
          name="username"
          rules={[
            {
              required: true,
              message: 'Please input your username!',
            },
          ]}
        >
          <Input />
        </Form.Item>

        <Form.Item
          label="修 改 密 码: "
          name="password"
          
          rules={[
            {
              required: true,
              message: 'Please input your password!',
            },
          ]}
        >
          <Input.Password />
        </Form.Item>

        <Form.Item>
          <Button type="primary" htmlType="submit" style={{
            float: 'right'
          }}>
            修改
          </Button>
        </Form.Item>
      </Form>
    </div>
  );
}
